import { NavLink } from "react-router-dom";
import instagram from "./instagram.png";
import github from "./github.png";

function Footer() {
    return(
        <>
        <NavLink  to={{pathname: "https://www.instagram.com/tenomareen/"}} target="_blank"><img src={instagram} alt={"src"} height={48}></img></NavLink>
        <NavLink  to={{pathname: "https://github.com/Tenomareen"}} target="_blank"><img src={github} alt={"src"} height={48}></img></NavLink>
        </>
    );
}

export default Footer;
